  return (<section>
    <div>
      {/*text */}
      <div>
        <h3>Invest  Smart</h3>
        <p>Get full statistic information about the behaviour of buyers and sellers
          will help you to make the decision.
        </p>
        <button>Learn more</button>
      </div>
      {/*Image*/}
      <div>
        <img src={Image1}/>
      </div>
    </div>
  </section>)
  ;
};

export default FeaturesSection1;
